('1726','2','8186','Wohnung Nieraese',Null,'Sehr gepflegte 3-Schlafzimmer Duplex-Wohnung mit kleinem Garten','20591','Diese sehr gepflegte Duplexwohnung, liegt in einer beliebten Wohnlage von Bendinat-Illetas. Von hier aus sind es nur weniger als 5 Fahrminuten zum Golfplatz Bendinat, zum Einkaufscenter PORTO PI am Stadtrand von Palma und zu 3 Badestränden. \r\nDie Duplexwohnung verfügt über 3 Schlafzimmer und 2 Badezimmer, sowie eine kleine Gartenterrasse im Erdgeschoss. Die Wohnung erreicht man, mit einem Lift über die Tiefgarage (2 Stellplätze), oder auch von der Strasse aus.  Im Obergeschoss befinden sich der Eingang mit Diele, offene moderne Einbauküche, ein Gäste-WC und das geräumige Wohn-Esszimmer mit Panoramafenster und Zugang zur ca. 20 m² großen, überdachten Terrasse.\r\nZur guten Ausstattung gehören: Waschmaschine, Trockner, Einbauküche, Klimaanlage w/k, Gaszentralheizung, Doppelglasfenster mit Fliegengitter und 2 Terrassen-Markisen.  \r\nAllen Eigentümern steht ein Gemeinschaftspool eingebettet in einer großen, gepflegten Gartenanlage zur Verfügung.','20592','480000','111','2012-01-26 14:57:04','106','2012-01-26 14:57:37',Null,'1277','96','627',1,'1','0',Null,Null,Null,'20593',Null,'0','0','0',Null,'2016-02-03 12:14:13',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'20594',Null,'20595',Null,'20596',Null,'20597','Bertoletto, Jaquline von Didac Centrum Comercial Illetas 971.700.002','20598','0',0,'0');
